able cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"393238","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"393206","type":"BoxAnnotation"},{"attributes":{},"id":"392877","type":"SaveTool"},{"attributes":{"coordinates":null,"formatter":{"id":"393170"},"group":null,"major_label_policy":{"id":"393171"},"ticker":{"id":"392868"}},"id":"392867","type":"LinearAxis"},{"attributes":{},"id":"392864","type":"BasicTicker"},{"attributes":{"children":[[{"id":"392895"},0,0],[{"id":"393041"},1,0],[{"id":"392855"},2,0],[{"id":"393092"},3,0],[{"id":"393183"},4,0]]},"id":"393323","type":"GridBox"},{"attributes":{},"id":"392955","type":"BasicTickFormatter"},{"attributes":{},"id":"393171","type":"AllLabels"},{"attributes":{},"id":"393225","type":"AllLabels"},{"attributes":{"factors":["0","1"],"palette":["rgb(255.0, 220.40869565217392, 214.20000000000002)","rgb(214.20000000000005, 254.99999999999997, 214.20000000000005)"]},"id":"393142","type":"CategoricalColorMapper"},{"attributes":{"logo":null,"toolbars":[{"id":"392919"},{"id":"393065"},{"id":"392879"},{"id":"3
